    feedback += "• **C2** (Tema): ".concat(notas_competencias.C2, "/200\n");
    feedback += "• **C3** (Organização): ".concat(notas_competencias.C3, "/200\n");
    feedback += "• **C4** (Coesão): ".concat(notas_competencias.C4, "/200\n");
    feedback += "• **C5** (Proposta): ".concat(notas_competencias.C5, "/200\n\n");
